import React, { Component } from 'react'

export default class Child extends Component {
  render() {
    console.log(this.props);
    let { productName,ProductCategory,Z}=this.props.productInfo;
    return (
      <>
      <h2>{ productName}</h2>
      <h2>{ProductCategory}</h2>
      <h2>{Z}</h2>
      </>
    )
  }
}
